import CourseList from "./components/course/CourseList";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return <div className="App">
    <Router>
      <Routes>
        <Route path="/courselist" element={<CourseList />} />
      </Routes>
    </Router>
  </div>;
}

export default App;
